import React from 'react';

const Sidebar = () => {
	return (
		<div className="mh3 mb3 w-100 w-40-ns ph3 h-50 baskerville bg-near-white br3 ba b--moon-gray">
			<h2 className=""><i>About us</i></h2>
			<p className="sans-serif">The <em>Bummer City Historical Society & Civic Engagement Coalition</em> is a Boston-based community of DIY artists and organizers trying to develop intentional, inclusive, civically engaged communities throughout the Greater Boston area.</p>
		</div>
	);
};

export default Sidebar;
